import React from 'react'

export default function EmptyOrders() {
    return (
        <div className="container mt-5">
            <div className="row">
                <div className="col-10 mx-auto text-center text-title">
                  <h1>Your don't have any orders yet!!</h1>
               </div>
            </div>
        </div>
    );
}
